import { StyleSheet } from 'react-native';
import Constants from 'expo-constants';


export default StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 24,
    paddingTop: Constants.statusBarHeight + 20,
  },
  
  header: {
      paddingTop: '3%',
      marginHorizontal: 10,
      flexDirection: "row",
      // justifyContent: "flex-end",
      alignItems: "center"
	},
	
	listaProjetos: {
    marginTop: 0
  },

  projeto: {
    padding: 24,
    marginBottom: 0,
		borderBottomWidth: 1,
		borderBottomColor: "#2AB940"
  },

  projetoTipo: {
    fontSize: 14,
    color: '#41414d',
    marginTop: 5,
    fontWeight: 'bold'
  },

  projetoNome: {
    fontSize: 14,    
    color: '#737380'
  },

  searchInput: {
		flex: 1,
		height: 45,
		backgroundColor: "#fff",
		color: "#363636",
		borderRadius: 25,
		paddingHorizontal: 20,
		fontSize: 14,
		shadowColor: "#000",
		shadowOffset: {
			width: 4,
			height: 4,
		},
		elevation: 4,
	},
	loadButton: {
		width: 45,
		height: 45,
		backgroundColor: "#2AB940",
		borderRadius: 25,
		justifyContent: "center",
		alignItems: "center",
		marginLeft: 15,
		shadowColor: "#000",
		shadowOffset: {
			width: 4,
			height: 4,
		},
		elevation: 4,
	}

});
